import "./First.css";
import styled from "styled-components";

export default function First() {
  return (
    <div className="firstcenter">
      <div className="firstspace">
        <img
          className="hand"
          style={{ width: "100%" }}
          src="/img/img1.png"
        ></img>
        <img
          className="hand"
          style={{ width: "100%" }}
          src="/img/img2.png"
        ></img>
        <img
          className="hand"
          style={{ width: "30%" }}
          src="/img/img3.png"
        ></img>
      </div>
    </div>
  );
}
